	private void setRotation(ModelRenderer model, float x, float y, float z) {
		model.rotateAngleX = x;
		model.rotateAngleY = y;
		model.rotateAngleZ = z;
	}

	public void setAngles() {
		// reset the rotation point each render tick
		body.rotationPointY = 24F;
	}

	public void animate(IAnimatedEntity entity, float f, float f1, float f2,
			float f3, float f4, float f5) {
		anim.update(entity);
		setAngles();

		anim.setAnim(1);
		anim.startPhase(10);

		anim.rotate(head_1, -PI / 6F, 0F, 0F);
		anim.rotate(body, -PI / 6F, 0F, 0F);

		anim.move(body, PI, 0F, 0F);
		anim.move(head_1, PI / 6F, 0F, 0F);
		anim.endPhase();

		anim.startPhase(4);
		anim.rotate(body, -PI / 2F, 0F, 0F);
		anim.move(body, 0F, -2F, 0F);
		anim.endPhase();
		anim.setStationaryPhase(6);
		anim.resetPhase(10);

		anim.setAnim(2);
		anim.startPhase(10);
		anim.rotate(head_1, 0F, -PI / 4F, 0F);
		anim.rotate(body, 0F, -PI / 10F, 0F);
		anim.endPhase();
		anim.startPhase(10);
		anim.rotate(head_1, 0F, PI / 4F, 0F);
		anim.rotate(body, 0F, PI / 8F, 0F);
		anim.endPhase();
		anim.resetPhase(10);

	}

